type SvgBlobProps = {
  patternId: number;
};

export const SvgBlob: FC<SvgBlobProps> = (props) => {
  const pattern = patterns[props.patternId];

  return (
    <svg xmlns="http://www.w3.org/2000/svg" width="100%" opacity="1" version="1.1" viewBox={pattern.viewBox}>
      <defs>
        <linearGradient id={pattern.id} x1="0%" x2="0%" y1="0%" y2="100%">
          <stop offset="0%" stopColor={pattern.stopColors[0]}></stop>
          <stop offset="100%" stopColor={pattern.stopColors[1]}></stop>
        </linearGradient>
      </defs>
      <path id="blob" fill={`url(#${pattern.id})`} style={{ opacity: 1 }}>
        <animate attributeName="d" dur="10s" repeatCount="indefinite" values={pattern.path}></animate>
      </path>
    </svg>
  );
};
